import React, { useState } from 'react';

function App() {
  const [country, setCountry] = useState('France');
  const [model, setModel] = useState('linear');
  const [horizon, setHorizon] = useState(14);
  const [predictions, setPredictions] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const availableCountries = [
    'France',
    'United States',
    'Brazil',
    'India',
    'Germany',
    'United Kingdom'
  ];
  const availableModels = [
    { value: 'linear', label: 'Régression linéaire' },
    { value: 'random_forest', label: 'Forêt aléatoire' }
  ];

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);
    setLoading(true);
    try {
      const response = await fetch(
        `http://localhost:5000/predict?country=${encodeURIComponent(
          country
        )}&model=${encodeURIComponent(model)}&horizon=${horizon}`
      );
      if (!response.ok) {
        throw new Error('Erreur lors de la requête');
      }
      const data = await response.json();
      setPredictions(data.predictions || []);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App" style={{ fontFamily: 'Arial, sans-serif', margin: '2rem' }}>
      <h1>Prédicteur de pandémie</h1>
      <form onSubmit={handleSubmit} style={{ marginBottom: '2rem' }}>
        <div style={{ marginBottom: '1rem' }}>
          <label>
            Pays&nbsp;
            <select
              value={country}
              onChange={(e) => setCountry(e.target.value)}
            >
              {availableCountries.map((c) => (
                <option key={c} value={c}>
                  {c}
                </option>
              ))}
            </select>
          </label>
        </div>
        <div style={{ marginBottom: '1rem' }}>
          <label>
            Modèle&nbsp;
            <select
              value={model}
              onChange={(e) => setModel(e.target.value)}
            >
              {availableModels.map((m) => (
                <option key={m.value} value={m.value}>
                  {m.label}
                </option>
              ))}
            </select>
          </label>
        </div>
        <div style={{ marginBottom: '1rem' }}>
          <label>
            Horizon (jours)&nbsp;
            <input
              type="number"
              min="1"
              max="60"
              value={horizon}
              onChange={(e) => setHorizon(e.target.value)}
            />
          </label>
        </div>
        <button type="submit" disabled={loading}>
          {loading ? 'Chargement...' : 'Prédire'}
        </button>
      </form>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      {predictions.length > 0 && (
        <div>
          <h2>Résultats</h2>
          <table border="1" cellPadding="5" style={{ borderCollapse: 'collapse' }}>
            <thead>
              <tr>
                <th>Date</th>
                <th>Prédiction</th>
              </tr>
            </thead>
            <tbody>
              {predictions.map((p, idx) => (
                <tr key={idx}>
                  <td>{p.date}</td>
                  <td>{p.prediction}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default App;
